import './App.css'; 

const App = () => {
  return <div> First div
      <div className="App">
        <ul>
          <li>css</li>
          <li>html</li>
          <li>js</li>
          <li>react</li>
        </ul>
      </div>
    </div>
}


const NewComponent = () => {
  return <div>
    <h4>New Component</h4>
  </div>
}

const Header = () => {
  return <div>
    <a>Home </a>
    <a>Mews Feed </a>
    <a>Messages </a>
  </div>
}

export default App;
